@font-face {

body {
	background-color: #dfddec;
}
section {
	padding: 20px 20px;
	max-width: 1200px;
	margin: 0 auto;
	font-family: sans-serif;
}
.card {
	position: relative;
	display: flex;
	flex-direction: column;
	min-width: 0;
	word-wrap: break-word;
	background-color: #fff;
	background-clip: border-box;
	border: 1px solid rgba(0, 0, 0, 0.06);
	font-size: 1rem;
	font-weight: normal;
	box-shadow: 0px 0px 12px 0px rgba(63, 89, 105, 0.05);
	margin: 18px 0;
	border-radius: 0.25rem;
}
.card-header {
	padding: 1.5rem 1.5rem;
	margin-bottom: 0;
	background-color: transparent;
	border-bottom: 1px solid rgba(0, 0, 0, 0.06);
}
.card-header_title {
	font-size: 20px;
	margin: 0;
}
.card-header h3 {
	margin: 0;
}
.card-body {
	flex: 1 1 auto;
}
.card-section {
	padding: 1.5rem 1.5rem;
}
.card-footer {
	padding: 1.5rem 1.5rem;
	background-color: transparent;
	border-top: 1px solid rgba(0, 0, 0, 0.06);
	overflow: hidden;
}
.fonticons-row {
	display: flex;
	flex-wrap: wrap;
	margin-right: -15px;
	margin-left: -15px;
}
.fonticon-container {
	position: relative;
	width: 100%;
	min-height: 1px;
	padding-right: 15px;
	padding-left: 15px;
	flex: 0 0 16.66666667%;
	max-width: 16.66666667%;
	margin-bottom: 25px;
	display: flex;
	align-items: center;
}
@media (max-width: 1280px) {
	.fonticon-container {
		flex: 0 0 25%;
		max-width: 25%;
	}
}
@media (max-width: 860px) {
	.fonticon-container {
		flex: 0 0 33.33333333%;
		max-width: 33.33333333%;
	}
}
@media (max-width: 640px) {
	.fonticon-container {
		flex: 0 0 50%;
		max-width: 50%;
	}
}
@media (max-width: 480px) {
	.fonticon-container {
		flex: 0 0 100%;
		max-width: 100%;
	}
}
.fonticon-container .fonticon-wrap {
	width: 60px;
	height: 60px;
	margin-right: 1rem;
	position: relative;
	display: flex;
	align-items: center;
	justify-content: center;
	box-sizing: border-box;
	flex: 0 0 auto;
}
.fonticon-container .fonticon-wrap i {
	font-size: 2.28rem;
	transition: all 0.2s ease-in-out;
}
.fonticon-container .fonticon-wrap i.fa {
	font-size: 2.28rem !important;
}
.fonticon-container .fonticon-wrap.youtube {
	width: 100px;
}
.fonticon-container:hover i {
	color: #0063ab;
	font-size: 2.4rem;
	transform: scale(1.3);
}
.fonticon-container .fonticon-classname,
.fonticon-container .fonticon-unit {
	display: block;
	font-size: 1rem;
	line-height: 1.2;
}
.fonticon-container .fonticon-unit {
	font-size: 0.7rem;
	font-style: italic;
	margin-top: 3px;
}

[class^="la-"],
[class*=" la-"] {
	display: inline-block;
	font-size: inherit;
	text-decoration: inherit;

	-webkit-font-smoothing: antialiased;
